import React from "react";
import { useParams } from "react-router";

const RouterContact = () => {
    let {name} = useParams();

    return (
        <>
        <h1 className = "text-center text-capitalize text-info display-3">This is the Contact webpage</h1>
        </>
    )
}

export default RouterContact;
